              "$ref": "#/components/schemas/Error"
            }
          }
        }
      }
    },
    "schemas": {
      "Error": {
        "type": "object",
        "properties": {
          "code": {
            "type": "string"
          },
          "message": {
            "type": "string"
          }
        },
        "required": [
          "code",
          "message"
        ]
      },
      "Query": {
        "type": "object",
        "properties": {
          "query": {
            "type": "object"
          },
          "options": {
            "type": "object"
          }
        }
      },
      "User": {
        "type": "object",
        "required": [
          "key",
          "role"
        ],
        "properties": {
          "name": {
            "type": "string",
            "default": null
          },
          "key": {
            "type": "string"
          },
          "role": {
            "type": "string",
            "enum": [
              "superuser",
              "user",
              "create",
              "update",
              "delete"
            ]
          }
        }
      },
      "Capsule": {
        "type": "object",
        "required": [
          "serial",
          "status",
          "type"
        ],
        "properties": {
          "serial": {
            "type": "string"
          },
          "status": {
            "type": "string",
            "enum": [
              "unknown",
              "active",
              "retired",
              "destroyed"
            ]
          },
          "type": {
            "type": "string",
            "enum": [
              "Dragon 1.0",
              "Dragon 1.1",
              "Dragon 2.0"
            ]
          },
          "dragon": {
            "type": "string",
            "format": "uuid"
          },
          "reuse_count": {
            "type": "integer",
            "format": "int64",
            "default": 0
          },
          "water_landings": {
            "type": "integer",
            "format": "int64",
            "default": 0
          },
          "land_landings": {
            "type": "integer",
            "format": "int64",
            "default": 0
          },
          "last_update": {
            "type": "string",
            "default": null
          },
          "launches": {
